    min(v_max, v_alpha + a_max * delta_t, v_safe, 'includenan', 'all'); % Add includenan and all arguments

% Update the velocity of each car
for i = 1:num_cars
    if i == 1 % The first car is always moving at a constant speed
        cars{i}.velocity = 25;
    else
        s_alpha = cars{i-1}.position - cars{i-1}.length - cars{i}.position;
        v_safe = cars{i}.velocity - cars{i}.length / 2 / tau_k;
        v_alpha = cars{i}.velocity;

        % Ensure that the sizes of v_alpha and v_safe are the same
        if size(v_alpha) ~= size(v_safe)
            v_alpha = repmat(v_alpha, size(v_safe));
        end

        cars{i}.velocity = krauss(s_alpha, v_alpha, v_safe);
    end

    % Ensure that the sizes of cars{i}.velocity and v_safe_0 are the same
    if size(cars{i}.velocity) ~= size(v_safe_0)
        cars{i}.velocity = repmat(cars{i}.velocity, size(v_safe_0));
    end

    % Update the velocity of the car and ensure it is not greater than v_des
    cars{i}.velocity = v_des(cars{i}.velocity, v_safe_0);

    % Update the position of the car
    cars{i}.position = cars{i}.position + cars{i}.velocity * delta_t;
end

