study(title="Double Tops and Bottoms", overlay=true)

// Choose your preferred time frame
tf = input(title="Timeframe", type=input.resolution, defval="D")

// Define the high and low parameters
high = security(syminfo.tickerid, tf, high)
low = security(syminfo.tickerid, tf, low)

// Determine the length of the pattern
len = input(title="Pattern Length", type=input.integer, defval=10)

// Determine the tolerance level for the pattern
tolerance = input(title="Pattern Tolerance", type=input.float, defval=0.05)

// Calculate the first peak and valley of the pattern
peak1 = valuewhen(high == highest(high, len), high, 0)
valley1 = valuewhen(low == lowest(low, len), low, 0)

// Calculate the second peak and valley of the pattern
peak2 = valuewhen(high == highest(high, len), high, 1)
valley2 = valuewhen(low == lowest(low, len), low, 1)

// Check if the pattern is a double top or double bottom
double_top = peak1 > peak2 * (1 - tolerance) and (peak1 - peak2) > (peak2 - valley2) and peak2 < valley1 * (1 + tolerance)
double_bottom = valley1 < valley2 * (1 + tolerance) and (valley2 - valley1) > (peak2 - valley2) and valley2 > peak1 * (1 - tolerance)

// Plot the pattern
plotshape(series=double_top ? peak2 : double_bottom ? valley2 : na, title="Pattern", style=shape.triangleup, color=color.green, location=location.absolute, size=size.tiny)

// Add labels for the pattern type
if double_top
    label.new(x=bar_index, y=peak2, text="Double Top", style=label.style_label_up, color=color.green)
else if double_bottom
    label.new(x=bar_index, y=valley2, text="Double Bottom", style=label.style_label_down, color=color.red)

