{% assign input = task.input_data %}
{% assign credit_memos = input.credit_memos %}
{% assign account_id = input.account_id %}

{% assign sorted_credit_memos = credit_memos | sort: 'memo_date' %}
{% assign applied_credit_memos = '' %}

{% assign invoice_ids = '' %}
{% capture invoice_id_string %} {% endcapture %}

{% for credit_memo_item in sorted_credit_memos %}
   {% assign available_credit = credit_memo_item.balance %}

   {% if available_credit > 0 %}
       {% assign applied_credit_memos = applied_credit_memos | append: ',' | append: credit_memo_item.id %}

       {% capture credit_memo_objectref %}{% model 'CreditMemo' id = credit_memo_item.id %}{% endcapture %}
       {% assign credit_memo = credit_memo_objectref.object %}

       {% capture invoice_objectrefs %}{% retrieve_objects 'Invoice' query = "status != 'Canceled' and account.id = '" | append: account_id | append: "' and balance > 0 and balance <= " | append: available_credit | append: " order by due_date asc " %}{% endcapture %}

       {% assign invoices = invoice_objectrefs.objects %}

       {% for invoice in invoices %}
           {% capture invoice_id %}{{ invoice.id }}{% endcapture %}
           {% assign invoice_amount = invoice.balance %}

           {% assign invoice_ids = invoice_ids | append: ',' | append: invoice_id %}
           {% capture invoice_id_string %}{{ invoice_id_string }}\n{{ invoice_id }}{% endcapture %}

           {% capture invoice_objectref %}{% model 'Invoice' id = invoice_id %}{% endcapture %}
           {% assign invoice = invoice_objectref.object %}

           {% assign invoice.line_items[0].amount = invoice_amount minus: available_credit %}
           {% assign invoice.balance = invoice.balance minus: available_credit %}
           {% update_object invoice_objectref %}

           {% capture revenue_event_objectrefs %}{% retrieve_objects 'RevenueEvent' query = "invoice.id = '" | append: invoice_id | append: "' and recognized_revenue > 0 order by recognized_date desc " %}{% endcapture %}

           {% for revenue_event_objectref in revenue_event_objectrefs.objects %}
               {% assign revenue_event = revenue_event_objectref.object %}
               {% assign amount_to_close = revenue_event.recognized_revenue %}
               {% assign amount_closed = 0 %}

               {% for revenue_item in revenue_event.revenue_items %}
                   {% if amount_closed < amount_to_close %}
                       {% assign amount_remaining = amount_to_close minus: amount_closed %}
                       {% if amount_remaining <= available_credit %}
                           {% assign amount_closed = amount_closed plus: amount_remaining %}
                           {% assign available_credit = available_credit minus: amount_remaining %}
                           {% assign revenue_item.credit_memos_applied = (revenue_item.credit_memos_applied | append: ',' | append: credit_memo_item.id) %}
                       {% else %}
                           {% assign amount_closed = amount_closed plus: available_credit %}
                           {% assign remaining_credit_memo_objectref %}{% model 'CreditMemo' %}{% create_object 'CreditMemo' credit_memo_item.attributes %}{% endcapture %}
                           {% assign remaining_credit_memo = remaining_credit_memo_objectref.object %}
                           {% assign remaining_credit_memo.line_items[0].amount = available_credit %}
                           {% assign remaining_credit_memo.applied_to_invoice_items = invoice_id %}
                           {% update_object remaining_credit_memo_objectref %}
                           {% assign revenue_item.credit_memos_applied = (revenue_item.credit_memos_applied | append: ',' | append: remaining_credit_memo.id) %}
                           {% assign available_credit = 0 %}
                       {% endif %}
                   {% endif %}
               {% endfor %}

               {% if amount_closed > 0 %}
                   {% assign revenue_event.amount = revenue_event.amount minus: amount_closed %}
                   {% assign revenue_event.recognized_revenue = revenue_event.recognized_revenue minus: amount_closed %}
                   {% update_object revenue_event_objectref %}
               {% endif %}

               {% if available_credit == 0 %}
                   {% break %}
               {% endif %}
           {% endfor %}
       {% endfor %}

       {% assign credit_memo.line_items[0].amount = credit_memo_item.balance minus: available_credit %}
       {% assign credit_memo.applied_to_invoice_items = invoice_ids %}

       {% if available_credit > 0 %}
           {% capture remaining_credit_memo_objectref %}{% model 'CreditMemo' %}{% create_object 'CreditMemo' credit_memo_item.attributes %}{% endcapture %}
           {% assign remaining_credit_memo = remaining_credit_memo_objectref.object %}
           {% assign remaining_credit_memo.line_items[0].amount = available_credit %}
           {% update_object remaining_credit_memo_objectref %}
           {% assign credit_memo.applied_to_invoice_items = (credit_memo.applied_to_invoice_items | append: ',' | append: remaining_credit_memo.applied_to_invoice_items) %}
       {% endif %}

       {% update_object credit_memo_objectref %}
   {% endif %}

   {% if available_credit > 0 %}
       {% capture remaining_credit_memo_objectref %}{% model 'CreditMemo' %}{% create_object 'CreditMemo' credit_memo_item.attributes %}{% endcapture %}
       {% assign remaining_credit_memo = remaining_credit_memo_objectref.object %}
       {% assign remaining_credit_memo.line_items[0].amount = available_credit %}
       {% assign credit_memo_item.balance = available_credit %}
       {% assign remaining_credit_memo.applied_to_invoice_items = invoice_id_string %}
       {% update_object remaining_credit_memo_objectref %}
   {% endif %}
{% endfor %}

