module cpu_decoder(
    input [31:0] instruction,
    output reg [31:0] decoded_opcode,
    output reg [31:0] decoded_operand,
    output reg [31:0] decoded_register1,
    output reg [31:0] decoded_register2,
    output reg [31:0] decoded_immediate
);

// Default values for decoded outputs
assign decoded_opcode = 32'd0;
assign decoded_operand = 32'd0;
assign decoded_register1 = 5'd0;
assign decoded_register2 = 5'd0;
assign decoded_immediate = 16'd0;

// Sample instruction format with opcodes
parameter R_FORMAT = 6'd0,
          I_FORMAT = 6'd1,
          J_FORMAT = 6'd2;

// Extract opcode and format from instruction
wire [5:0] opcode = instruction[31:26];
wire [5:0] opcode_format = 
    (opcode == 6'b000000) ? R_FORMAT :
    (opcode == 6'b001000 || opcode == 6'b001100) ? I_FORMAT :
    (opcode == 6'b000010 || opcode == 6'b000011) ? J_FORMAT : 6'd0;

// Decode the instruction based on its format
always @*
begin
    case (opcode_format)
        R_FORMAT: begin
            decoded_opcode = opcode;
            decoded_register1 = instruction[25:21];
            decoded_register2 = instruction[20:16];
            decoded_operand = instruction[15:0];
        end
        I_FORMAT: begin
            decoded_opcode = opcode;
            decoded_register1 = instruction[25:21];
            decoded_register2 = instruction[20:16];
            decoded_immediate = instruction[15:0];
        end
        J_FORMAT: begin
            decoded_opcode = opcode;
            decoded_operand = instruction[25:0];
        end
        default: begin
            decoded_opcode = 32'd0;
            decoded_operand = 32'd0;
            decoded_register1 = 5'd0;
            decoded_register2 = 5'd0;
            decoded_immediate = 16'd0;
        end
    endcase
end

endmodule

