        "field": "message",
        "patterns": [
          "%{SYSLOGTIMESTAMP:syslog_timestamp} %{IPORHOST:syslog_server} %{SYSLOGPROG}: %{IP:client_ip}:%{INT:client_port} \\[%{HAPROXYDATE:accept_date}\\] %{NOTSPACE:frontend_name} %{NOTSPACE:backend_name}/%{NOTSPACE:server_name} %{INT:time_request}/%{INT:time_queue}/%{INT:time_backend_connect}/%{INT:time_backend_response}/%{NOTSPACE:time_duration} %{INT:http_status_code} %{NOTSPACE:bytes_read} %{DATA:captured_request_cookie} %{DATA:captured_response_cookie} %{NOTSPACE:termination_state} %{INT:actconn}/%{INT:feconn}/%{INT:beconn}/%{INT:srvconn}/%{NOTSPACE:retries} %{INT:srv_queue}/%{INT:backend_queue} \\{%{IPORHOST:request_header_x_forwarded_for}\\|\"%{QUOTEDSTRING:request_header_user_agent}\"\\|\"%{QUOTEDSTRING:request_header_referer}\"\\} \"%{WORD:http_verb} %{URIPATH:http_request}( HTTP/%{NUMBER:http_version}\")"
        ],
        "pattern_definitions": {
          "HAPROXYDATE": "%{MONTHDAY}/%{MONTH}/%{YEAR}:%{TIME}",
          "HAPROXYTIME": "%{HOUR}:%{MINUTE}:%{SECOND}.%{INT}"
        }
      }
    }
  ]
}

POST _reindex
{
  "source": {
    "index": "<your-source-index>"
  },
  "dest": {
    "index": "<your-destination-index>"
  },
  "script": {
    "source": """
      def grokPatterns = [
        "HAPROXY_DATE": "%{MONTHDAY}/%{MONTH}/%{YEAR}:%{TIME}",
        "HAPROXY_TIME": "%{HOUR}:%{MINUTE}:%{SECOND}.%{INT}"
      ];

      def grokExpression = "%{SYSLOGTIMESTAMP:syslog_timestamp} %{IPORHOST:syslog_server} %{SYSLOGPROG}: %{IP:client_ip}:%{INT:client_port} \\[%{HAPROXY_DATE:accept_date}\\] %{NOTSPACE:frontend_name} %{NOTSPACE:backend_name}/%{NOTSPACE:server_name} %{INT:time_request}/%{INT:time_queue}/%{INT:time_backend_connect}/%{INT:time_backend_response}/%{NOTSPACE:time_duration} %{INT:http_status_code} %{NOTSPACE:bytes_read} %{DATA:captured_request_cookie} %{DATA:captured_response_cookie} %{NOTSPACE:termination_state} %{INT:actconn}/%{INT:feconn}/%{INT:beconn}/%{INT:srvconn}/%{NOTSPACE:retries} %{INT:srv_queue}/%{INT:backend_queue} {%{IPORHOST:request_header_x_forwarded_for}\\\\|\"%{QUOTEDSTRING:request_header_user_agent}\"\\\\|\"%{QUOTEDSTRING:request_header_referer}\"\\\\} \"%{WORD:http_verb} %{URIPATH:http_request}( HTTP/%{NUMBER:http_version}\")";

      for (def entry : grokPatterns) {
        grokPatterns.each { k, v -> grokPatterns[k] = v.replace('\\\\', '\\\\\\\\') }
      }

      ctx._source.message = ctx._source.message.replaceAll("\\\\[", "[");
      ctx._source.message = ctx._source.message.replaceAll("\\\\]", "]");
      ctx._source.message = ctx._source.message.replaceAll("\\\\{", "{");
      ctx._source.message = ctx._source.message.replaceAll("\\\\}", "}");

      def grokProcessor = [
        "grok": [
          "field": "message",
          "patterns": [grokExpression],
          "pattern_definitions": grokPatterns
        ]
      ];

      ctx._source.remove("message");
      ctx._source.remove("log");

      ctx._source.haproxy = grokProcessor;
    """
  }
}

