// Transaction sequencing
  always_ff @(posedge clk) begin
    if (apb_txn.ctrl == READ || apb_txn.ctrl == WRITE) begin
      assert (state == IDLE) else $error("Invalid state for new transaction");
    end else if (apb_txn.ctrl == IDLE) begin
      assert (state == IDLE) else $error("Invalid state for IDLE transaction");
    end
  end

// Check transaction completion and acknowledgment
  always_ff @(posedge clk) begin
    if (state == READ || state == WRITE)
      assert (rsp_insn_Phase.ack && !rsp_insn_Phase.err) else $error("Invalid read/write completion");
    else if (state == IDLE)
      assert (!rsp_insn_Phase.ack);
  end

