module clock_divider_800ms(
    input wire clk_50MHz,  // 50 MHz clock input
    input wire rst_n,      // Active low reset
    output reg slow_clk    // Output clock with 800ms period
);

// Assuming a 50MHz clock and wanting an 800ms period
// Number of cycles for half the period (400ms) = 20,000,000

localparam COUNT_MAX = 40_000_000 - 1;  // -1 because counting starts from 0

reg [25:0] counter; // 26-bit counter to hold values up to 40,000,000

always @(posedge clk_50MHz or negedge rst_n) begin
    if (!rst_n) begin
        // Async reset
        counter <= 0;
        slow_clk <= 0;
    end else begin
        if (counter == COUNT_MAX) begin
            counter <= 0;
            slow_clk <= ~slow_clk; // Toggle the slow_clk output
        end else begin
            counter <= counter + 1;
        end
    end
end

endmodule

